 @noobchignekrasov7870  я всё ж решил для себя что 4070 мой вариант. Я только на ноуте карту в щи погнал (10 мгц больше дашь и вот уже арты) и то там с вольтажом не поиграешься. Андервольт ни разу в жизни не делал. Я даже фз как ручками оперативку гнать (стоит XMP 3466 и по моему 19 тайминги. Двухранговая, поэтому думаю ОК всё. С x3d там вообще наверное пофиг будет, лишь бы не 2666).
Поэтому 4070, без всяких андервольтов и БП моему будет меньше риск накрыться раньше положенного (DEEPCOOL PK600D), для QHD думаю та карта как щас для меня 3060 в FHD. Видеопамяти увы впритык, но игры многие не стоят внимания, а какие я удостаиваю своего прохождения имеют чаще всего адекватную оптимизацию. Хочется чтобы DLSS работал с меньшими просадками fps (на 3060 (если что 12гб версия) на 5-10 кадров просел в том же сралкере 2), да и MFG пощупать в самом нормальном режиме (думаю на x3-4 задержки меня не устроят. Я адепт игры в 120fps с Reflex на ультра либо 130-140 если Reflex-а нету. В драйвере низкая задержка на ультра и в Riva Tuner рефлекс включен (правда фз работает ли)). Там комплексное взвешивание у меня было, но я щас всего не вспомню, увы. За 45-50к эту карту реально достать в нормальном исполнении (корпус всё равно очень продуваемый и просторный).
p.s.: вспомнил. PCI ещё у меня 4й, а АМ5 я не скоро собирать буду. Всего скорее когда он по бабкам будет +- как щас АМ4 стоит (свой комплект с Ryzen 5 5600x + B550m Aourus elite + 32гб ОЗУ брал за 24). Ну и да, вроде есть 1700й сокет у интел с PCI5, но их я ещё не копал. Может оно по выгоде и лучше будет чем АМ5.
